import React, { Component } from 'react'
import Link from './Poi'

class LinkList extends Component {
  render() {
    const PoisToRender = [
      {
        id: '1',
        name:'Brunhildes Prunsbrunnen'
      },
      {
        id: '2',
        name: 'The best GraphQL client'
      },
    ]

    return (
      <div>{PoisToRender.map(poi => <Poi key={poi.id} poi={poi} />)}</div>
    )
  }
}

export default LinkList
